  return (
    <header>
      <div className="container header__container">
        <h5>Hello I'm</h5>
        <h1><span>D</span>aniel <span>G</span>omes</h1>
        <h5 className="text-light"> Fullstack Developer</h5>
        <CTA />
        <HeaderSocials />


        <div className="me">
          <img src={ME} alt="me" />
        </div>

        <a href="#contact" className="scroll__down">Scroll Down</a>
      </div>
    </header>
  );
};

export default Header;
